        <script type="text/javascript">
            function getScript(e, i) {
                var n = document.createElement("script");
                n.type = "text/javascript",
                n.async = !0,
                i && (n.onload = i),
                n.src = e,
                document.head.appendChild(n)
            }
            function parseMessage(e) {
                var i = e.data
                  , n = i.indexOf(DOLLAR_PREFIX + RECEIVE_MSG_PREFIX);
                if (-1 !== n) {
                    var t = i.slice(n + 2);
                    return getMessageParams(t)
                }
                return {}
            }
            function getMessageParams(e) {
                var i, n = [], t = e.split("/"), a = t.length;
                if (-1 === e.indexOf(RECEIVE_MSG_PREFIX)) {
                    if (a >= 2 && a % 2 === 0)
                        for (i = 0; a > i; i += 2)
                            n[t[i]] = t.length < i + 1 ? null : decodeURIComponent(t[i + 1])

                if (!i || i.name === GET_DAPI_URL_MSG_NAME) {
                    var n = i.data;
                    getScript(n, onDapiReceived)
                }
            }
            function invokeDapiListeners() {

                    dapiEventsPool.hasOwnProperty(e) && dapi.addEventListener(e, dapiEventsPool[e])
            }
            function onDapiReceived() {
                dapi = window.dapi,
                window.removeEventListener("message", getDapi),
                invokeDapiListeners()
            }
            function init() {
                window.dapi.isDemoDapi && (window.parent.postMessage(DOLLAR_PREFIX + SEND_MSG_PREFIX + JSON.stringify({
                    state: "getDapiUrl"
                }), "*"),
                window.addEventListener("message", getDapi, !1))
            }
            var DOLLAR_PREFIX = "$$"
              , RECEIVE_MSG_PREFIX = "DAPI_SERVICE:"
              , SEND_MSG_PREFIX = "DAPI_AD:"
              , GET_DAPI_URL_MSG_NAME = "connection.getDapiUrl"
              , dapiEventsPool = {}
              , dapi = window.dapi || {
                isReady: function() {
                    return !1
                },

        </script>
        <script type="text/javascript">
            window.offWebGL = !0,
            window.onload = function() 
			{
                var app, isInit;
                function onReadyCallback() {
                    dapi.removeEventListener("ready", onReadyCallback);
                    dapi.getAudioVolume();
                    dapi.isViewable() && adVisibleCallback({
                        isViewable: !0
                    }),
                    dapi.addEventListener("viewableChange", adVisibleCallback),
                    dapi.addEventListener("adResized", adResizeCallback),
                    dapi.addEventListener("audioVolumeChange", function() {})
                }
                /*function adVisibleCallback(event) {
                    isInit ? event.isViewable && adResizeCallback(dapi.getScreenSize()) : (isInit = !0,
                    setTimeout(function() {
                        "undefined" != typeof superApp ? superApp.init({
                            before: function() {
                                app = superApp,
                                before()
                            }
                        }) : initGame(function(superApp) {
                            app = superApp,
                            before()
                        })
                    }, 500))
                }*/
				
				function adVisibleCallback(isViewable) {
                    isInit ? isViewable && adResizeCallback(dapi.getScreenSize()) : (isInit = !0,
                    setTimeout(function() {
                        "undefined" != typeof superApp ? superApp.init({
                            before: function() {
                                app = superApp,
                                before()
                            }
                        }) : initGame(function(superApp) {
                            app = superApp,
                            before()
                        })
                    }, 500))
                }
				
				
                function adResizeCallback(event) {
                    app && ("undefined" != typeof superApp ? app.resize({
                        width: event.width,
                        height: event.height
                    }) : app.resize(event.width, event.height))
                }
                function before() {
                    adResizeCallback(dapi.getScreenSize()),
                    "undefined" != typeof loader && loader.clear()
                }
                dapi.isReady() ? onReadyCallback() : dapi.addEventListener("ready", onReadyCallback);
				
				
				dapi.getScreenSize = function ()
				{
					return {width:window.innerWidth,height:window.innerHeight}
				}
				adVisibleCallback(true);
            }
            ,
            window.clickInstall = function() {
                void 0 !== dapi.openStoreUrl ? dapi.openStoreUrl() : console.log("click ad")
            }
            ;
			
			
        </script>
